import React from "react";
import Navbar from "../components/navbar"; // Import navbar
import "../styles/profile.css"; // Styles for profile page

const Profile = () => {
  return (
    <div className="page profile">
      <Navbar /> {/* Navbar at the top */}
      <h1>Profile Page</h1>
    </div>
  );
};

export default Profile;
